INSERT INTO `faq_tbl` (`group_id`, `index`, `question`, `answer`) VALUES
(1, 1, 'Μπορώ να δηλώσω και να παραλάβω Συγγράμματα για μαθήματα προηγούμενων εξαμήνων;', 'Ναι, εφόσον ο φοιτητής δεν έχει εξεταστεί επιτυχώς στο συγκεκριμένο μάθημα και δεν έχει παραλάβει ήδη σύγγραμμα για το μάθημα αυτό τα προηγούμενα έτη (ακόμη και αν το σύγγραμμα έχει αλλάξει)'),
(1, 2, 'Τι σημαίνει όταν δίπλα σε κάποιο Σύγγραμμα βλέπω την ένδειξη ''Διαθεσιμότητα: 0'';', 'Σημαίνει πως δεν υπάρχουν αντίτυπα του Συγγράμματος στο Σημείο Διανομής και ότι ο Εκδότης θα στείλει σύντομα νέα. Με την άφιξη των νέων αντιτύπων η εφαρμογή ενημερώνεται αυτόματα, οπότε ο Φοιτητής μπορεί ανατρέχοντας στην εφαρμογή να ενημερώνεται για το διαθέσιμο απόθεμα.'),
(1, 3, 'Σε περίπτωση απώλειας του προσωπικού κωδικού PIN, πως μπορεί να γίνει η ανάκτησή του;', 'Ο φοιτητής έχει τη δυνατότητα να επιλέξει επαναποστολή του κωδικού PIN από την εφαρμογή του στο ''Εύδοξος''.  Συγκεκριμένα, από την αρχική σελίδα στην οποία αναγράφονται τα στοιχεία του φοιτητή, πατάει: ''Δηλώσεις Συγγραμμάτων'' -> ''Ενημέρωση τρέχουσας δήλωσης'' ή ''Επισκόπηση'' για παλιότερη δήλωση -> ''Συνέχεια'' και στη νέα οθόνη θα μπορεί να επιλέξει ''Υπενθύμιση του αριθμού ΡΙΝ''. Το PIN θα εμφανιστεί στην οθόνη του και θα σταλεί και στο e-mail που έχει ορίσει στο ''Εύδοξος''.'),
(1, 4, 'Οι φοιτητές που υποβάλλουν μετεγγραφή σε ποιο τμήμα δικαιούνται να δηλώσουν Συγγράμματα;', 'Οι φοιτητές ή σπουδαστές, που υποβάλλουν αίτηση μετεγγραφής στις Γραμματείες των Τμημάτων και επέλεξαν διδακτικά συγγράμματα μέσω του πληροφοριακού συστήματος ''ΕΥΔΟΞΟΣ'', τα οποία προμηθεύτηκαν ενόσω φοιτούσαν ή σπούδαζαν στο Τμήμα προέλευσης, έχουν την δυνατότητα αφότου μετεγγραφούν στο Τμήμα υποδοχής να επιλέξουν εκ νέου συγγράμματα μέσω του ιδίου πληροφοριακού συστήματος. Οι μετεγγραφόμενοι φοιτητές ή σπουδαστές, που εξετάστηκαν ήδη στο Τμήμα προέλευσης, οφείλουν να δηλώσουν στο πληροφοριακό σύστημα μόνο τον αριθμό των μαθημάτων για τα οποία έχουν παραλάβει συγγράμματα και κατά την κρίση της Γενικής Συνέλευσης του Τμήματος υποδοχής απαλλάσσονται από την εξέταση τους. Εάν οι υποβάλλοντες αίτηση μετεγγραφής βρίσκονται στο πρώτο εξάμηνο σπουδών και δεν έχουν εξεταστεί στο τμήμα προέλευσης, τότε θα δηλώνουν μηδενικό αριθμό μαθημάτων.\r\nΟι φοιτητές ή σπουδαστές,  που υποβάλλουν ηλεκτρονικά αίτηση μετεγγραφής, δικαιούνται να επιλέξουν συγγράμματα μέσω του ίδιου πληροφοριακού συστήματος, μόνο αφού εγγραφούν στο Τμήμα υποδοχής.'),
(1, 5, 'Μπορώ να επιλέξω τώρα Συγγράμματα και για το Εαρινό Εξάμηνο;', 'Όχι, κατά την τρέχουσα περίοδο δήλωσης συγγραμμάτων δηλώνονται μόνο συγγράμματα για το χειμερινό εξάμηνο. Οι δηλώσεις για το εαρινό εξάμηνο θα γίνουν την αντίστοιχη περίοδο.'),
(2, 1, 'Είναι δυνατή η διάθεση Συγγραμμάτων χωρίς να γίνει χρήση της υπηρεσίας «Εύδοξος»;', 'Απαραίτητη για τη διάθεση Συγγραμμάτων από το ακαδημαϊκό έτος 2010-2011 είναι η χρήση της ηλεκτρονικής υπηρεσίας «Εύδοξος». Η διαδικασία που ακολουθείτο μέχρι τώρα δε θα εφαρμοσθεί για κανένα Δημόσιο Εκπαιδευτικό Ίδρυμα της Τριτοβάθμιας Εκπαίδευσης. Επισημαίνεται ότι στο Εύδοξος δε συμμετέχουν οι Στρατιωτικές Σχολές και τα Τμήματα του Ελληνικού Ανοιχτού Πανεπιστημίου.'),
(2, 2, 'Ποιοι έχουν δικαίωμα να καταχωρίσουν Συγγράμματα προς διάθεση;', 'Δικαίωμα καταχώρισης Συγγραμμάτων προς διάθεση σε Πανεπιστήμια/ΤΕΙ έχουν όσοι είναι δικαιούχοι ή/και έχουν αποκτήσει νομίμως τα δικαιώματα διανομής των αντίστοιχων Συγγραμμάτων.'),
(2, 3, 'Πρέπει να δηλωθούν τώρα και τα Συγγράμματα που αφορούν το εαρινό εξάμηνο;', 'Ναι. Πρέπει να δηλωθούν όλα τα Συγγράμματα για το επόμενο ακαδημαϊκό έτος.'),
(3, 1, 'Τι πρέπει να προσέξω για την ασφάλειά μου;', 'Για τη δική σας ασφάλεια σας συνιστούμε να επιλέξετε έναν συνδυασμό από γράμματα, αριθμούς και σύμβολα για να δημιουργήσετε ένα μοναδικό κωδικό πρόσβασης που δεν σχετίζεται με τα προσωπικά σας στοιχεία. Μπορείτε για παράδειγμα να επιλέξτε μια τυχαία λέξη ή φράση και εισαγάγετε αριθμούς ή σύμβολα στην αρχή, στη μέση και στο τέλος (για παράδειγμα "m1awra1ap3tal0uda"). Η χρήση απλών λέξεων ή φράσεων όπως "password" ή "12345", θα πρέπει να αποφεύγεται. Επίσης, σε περίπτωση που συνδέεστε στο σύστημα από δημόσιο υπολογιστή, βεβαιωθείτε ότι πάντα πατάτε το κουμπί "Αποσύνδεση" πάνω δεξιά στην οθόνη κατά την έξοδό σας και κλείνετε το φυλλομετρητή.'),
(3, 2, 'Πως καταχωρίζονται τα μαθήματα που έχουν Θεωρητικό και Εργαστηριακό μέρος;', 'Κάθε τέτοιο μάθημα θα πρέπει να καταχωριστεί οπωσδήποτε ως ενιαίο μάθημα στο Εύδοξος.'),
(3, 3, 'Πώς καταχωρίζονται τα υποχρεωτικά βοηθήματα, δηλαδή εκείνα για τα οποία οι φοιτητές δεν έχουν δυνατότητα εναλλακτικής επιλογής;', 'Τα υποχρεωτικά βοηθήματα πρέπει να δηλώνονται σε όλες τις Επιλογές που θα δημιουργηθούν για το αντίστοιχο μάθημα. Έτσι, εξασφαλίζεται ότι με οποιαδήποτε Επιλογή ο φοιτητής θα λάβει το συγκεκριμένο βοήθημα. Τα βοηθήματα αυτά πρέπει, προφανώς, να είναι καταχωρισμένα στην βάση του ΕΥΔΟΞΟΣ και να έχουν μοναδικό Κωδικό.'),
(3, 4, 'Μπορούν να διατεθούν ξενόγλωσσα Συγγράμματα μέσω του "Εύδοξος";', 'Βεβαίως, αρκεί να υπάρξει κάποιος Εκδότης, ο οποίος θα εγγυηθεί τη διάθεση αυτών των Συγγραμμάτων σύμφωνα με τους ισχύοντες κανόνες κοστολόγησης του Υπουργείου Παιδείας. Ειδικά για τα ξενόγλωσσα Συγγράμματα σε τμήματα Ξένων Φιλολογιών, υπάρχει ειδικό καθεστώς για την προμήθεια αυτών των Συγγραμμάτων από το οικείο ίδρυμα μέσω μειοδοτικών διαγωνισμών.');
